#include <stdio.h>
#include <stdlib.h>
#include <time.h>

void printArray(int arr[], int n)
{
    for(int i = 0; i < n; i++)
    {
    	printf("%d ", arr[i]);
    }
    printf("\n");
}

int partition(int arr[], int min, int max)
{
    int pivot = arr[min];
    int i = min - 1;
    int j = max + 1;

    while(1)
    {
    	do
    	{
            i++;
        }
    	while(pivot > arr[i]);
    	do
    	{
            j--;
        }
    	while(pivot < arr[j]);
        if(i >= j)
        {
            return j;
        }

        arr[i] = arr[i] + arr[j];
        arr[j] = arr[i] - arr[j];
        arr[i] = arr[i] - arr[j];
    }
}

int lastIndexPartition(int arr[], int min, int max)
{
  int pivot = arr[max];

  int i = min - 1;

  for(int j = min; j <= max; j++)
  {
    if(arr[j]<pivot)
    {
      i++;
      int temp = arr[i];
      arr[i] = arr[j];
      arr[j] = temp;
    }
  }

  int temp = arr[i + 1];
  arr[i + 1] = arr[max];
  arr[max] = temp;

  return (i + 1);
}

int randomPartition(int arr[], int min, int max)
{
    srand(time(0));
    int random = min + rand() % (max - min);

    int temp = arr[random];
    arr[random] = arr[min];
    arr[min] = temp;

    return partition(arr, min, max);
}

void randQuickSort(int arr[], int min, int max)
{
    if(min < max)
    {
        int pi = randomPartition(arr, min, max);
        randQuickSort(arr, min, pi);
        randQuickSort(arr, pi + 1, max);
    }
}

void quickSort(int arr[], int min, int max)
{
    if (min < max)
    {
        int pi = lastIndexPartition(arr, min, max);
        quickSort(arr, min, pi - 1);
        quickSort(arr, pi + 1, max);
    }
}

int ithOrder(int arr[], int i, int min, int max)
{
	if(min == max)
		return arr[min];
	int index = partition(arr, min, max);
	int k = index + 1 - min;

	if(i == k)
		return arr[index];
	else if(i < k)
		return ithOrder(arr, min, index - 1, i);
	else if(i > k)
		return ithOrder(arr, min, index + 1, i);
}

